css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("jsoneditoronline.org") {
  #header, #contents, .ace-jsoneditor .ace_scroller {
    background: url("data:image/png;base64,");
  }
  
  #header {
    border-color: #111;
    border-radius: 1px;
    border-style: solid;
    height: 34px;
  }
  
  .ace-jsoneditor .ace_variable {
	 color: rgb(0, 255, 0);
   font-weight: bold;
  }
  
  .ace-jsoneditor .ace_marker-layer .ace_active-line {
    background-color: #333;
  }
  
  .ace-jsoneditor .ace_indent-guide {
    background: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAACCAIAAAAW4yFwAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH4AoZDCQTwX3oigAAAB1pVFh0Q29tbWVudAAAAAAAQ3JlYXRlZCB3aXRoIEdJTVBkLmUHAAAAEElEQVQI12Ng+CfExMDAAAAGXgETzXzUdgAAAABJRU5ErkJggg==") right repeat-y
  }
  
  div.jsoneditor-field.jsoneditor-highlight, div.jsoneditor-field[contenteditable="true"]:focus, div.jsoneditor-field[contenteditable="true"]:hover, div.jsoneditor-value.jsoneditor-highlight, div.jsoneditor-value[contenteditable="true"]:focus, div.jsoneditor-value[contenteditable="true"]:hover {
	background-color: #00FF00;
	border: 1px solid #000;
	border-radius: 2px;
  color: #000;
  }
 
  
  div.jsoneditor-field {
	 color: #0F0;
    font-weight: bold;
  }
  
  div.jsoneditor-menu {
    background-color: #0A0 !important;
  }
  
  div.jsoneditor, div.jsoneditor-menu {
    border-color: #000 !important;
  }
  
  table.jsoneditor-search input, table.jsoneditor-search div.jsoneditor-frame {
    background-color: #222;
    color: #0F0;;
  }
  
  table.jsoneditor-search div.jsoneditor-results {
    color: #000;
  }
  
  tr.jsoneditor-highlight {
    background-color: #000;
  }
  
  .ace-jsoneditor .ace_gutter {
    background-color: #000;
    color: #0F0;
  }
  
  #footer {
    color: #0f0;
    border-top: 1px solid #0f0;
    background-color: #000;
  }
  
  #splitter #drag.active, #splitter #drag:hover {
    background-color: #000;
    color: #0F0;
  }
}
